import { useRef } from "react";

const Contact = () => {
  return (
    <div>
      h1(style='--x: 6; --y: -6;') for letter, index in 'Waaave'.split('')
      span(style=`--index: ${index}; --alpha-l: 0.125; --alpha-u: 0.25;`)=
      letter h1(style='--x: 3; --y: -3;') for letter, index in
      'Waaave'.split('') span(style=`--index: ${index}; --alpha-l: 0.25;
      --alpha-u: 0.5;`)= letter h1 for letter, index in 'Waaave'.split('')
      span(style=`--index: ${index}; --alpha-l: 0.5; --alpha-u: 1;`)= letter
    </div>
  );
};

export default Contact;
